import React, { useEffect } from "react";
import companylogo from "../image/company-logo.png";
function Home() {
  return (
    <>

    <nav>
        <div className="nav-view">
            <div className="container">
            
                   <div className="row">
                    <div className="col-md-6">
                    <div className="logo">
                        <img src={companylogo} className="img-fluid"/>
                    </div>
                    </div>
                    .col
                   </div>
                    
            
            </div>
        </div>
    </nav>

    </>
  );
}

export default Home;
